var title_f0_8_139="Pressure natriuresis and BP";
var content_f0_8_139=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F50178&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F50178&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Pressure natriuresis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 397px; height: 262px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The effect of increasing sodium intake on the mean arterial pressure. In normal animals, sodium intake can be raised from 1 to 25 meq/kg per day with virtually no elevation in the systemic blood pressure. In this setting, sodium excretion can be increased by lowering renin release without requiring a rise in BP. If, however, angiotensin II and aldosterone are fixed at either low or high levels, then there is a much lesser degree of tubular adaptation to increasing sodium intake. As a result, there is initial sodium retention until the renal perfusion pressure rises high enough to promote excretion of the excess sodium by pressure natriuresis. Overt hypertension is seen with high angiotensin II levels.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Guyton, AC, Science 1991; 252:1813.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
