"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Endometrial ablation (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H261992089\">",
"      <span class=\"h1\">",
"       What is endometrial ablation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Endometrial ablation (EA) is a surgery that makes a woman&rsquo;s period much lighter or stops it completely. It works by scarring the lining of the uterus (",
"      <a class=\"graphic graphic_figure graphicRef80271 \" href=\"UTD.htm?14/52/15171\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H261992074\">",
"      <span class=\"h1\">",
"       Why might a woman get EA?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor might recommend EA if you have heavy periods that do not get better with other treatments, such as medicines. Signs that you have a heavy period include that you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have a period that lasts more than 7 days",
"       </li>",
"       <li>",
"        Have to change a pad or tampon every 1 or 2 hours",
"       </li>",
"       <li>",
"        Pass large lumps of blood, called clots",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H261992057\">",
"      <span class=\"h1\">",
"       What happens during EA?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Before the procedure, you will get medicines that block pain. You might also get medicines to make you unconscious so you can&rsquo;t feel, see, or hear anything during surgery.",
"     </p>",
"     <p>",
"      Doctors use different techniques for EA. For most of these, the doctor puts a device into your vagina and up into your uterus. The device uses heat, cold, microwaves, or radio waves to scar the lining of your uterus.",
"     </p>",
"     <p>",
"      Another technique is called &ldquo;electrosurgery.&rdquo; It uses a device with an electric wire loop, a roller ball, or a spiked-ball tip to scar the lining of the uterus.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H261992040\">",
"      <span class=\"h1\">",
"       What happens after endometrial ablation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After the surgery, you might have:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Cramps for 1 to 3 days",
"       </li>",
"       <li>",
"        Light vaginal bleeding or pink vaginal discharge for 2 to 3 days",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In rare cases, EA causes heavy bleeding or a hole in the uterus.",
"     </p>",
"     <p>",
"      You will probably be able to do your normal activities 1 to 3 days after the surgery. Many women have irregular periods after the surgery. After 2 to 3 months, most women have lighter periods and some stop having periods completely.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H261992023\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Scarring in the uterus can make pregnancy unsafe for the mother or baby. You should not have this procedure if you want to get pregnant. But because women CAN still get pregnant after EA, doctors advise women who have the procedure to use birth control afterwards.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H261992007\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
